class Solution {
    func canTraverseAllPairs(_ nums: [Int]) -> Bool {
        let n = nums.count
        var parent = [Int](repeating: 0, count: n)
        for i in 0..<n {
            parent[i] = i // Initially, each node is its own parent.
        }

        func find(_ x: Int) -> Int {
            if parent[x] != x {
                parent[x] = find(parent[x]) // Path compression
            }
            return parent[x]
        }

        func union(_ x: Int, _ y: Int) {
            let rootX = find(x)
            let rootY = find(y)
            if rootX != rootY {
                parent[rootX] = rootY // Union
            }
        }

        for i in 0..<n {
            for j in i+1..<n {
                if gcd(nums[i], nums[j]) > 1 {
                    union(i, j)
                }
            }
        }

        // Check if all elements are connected.
        let root = find(0)
        for i in 1..<n {
            if find(i) != root {
                return false
            }
        }
        return true
    }

    private func gcd(_ a: Int, _ b: Int) -> Int {
        var a = a, b = b
        while b != 0 {
            (a, b) = (b, a % b)
        }
        return a
    }
}
